import React from 'react'

function Courses() {

  const data = [
    {
      // image : "assets/service/ship.png",
      text : "Bachelor Courses",
      subtext : "Free shipping  on all order"
    },
    {
      // image : "assets/service/support.png",
      text : "Master's Courses",
      subtext : "Support online 24 hours a day"
    },
    {
      // image : "assets/service/piggy.png",
      text : "Diploma Courses",
      subtext : "Back guatanree under 7 days"
    },
    {
      // image : "assets/service/badge.png",
      text : "MEMBER DISCOUNT",
      subtext : "Onevery order over 1000"
    },    

  ]

  return (
    <div>
          <div className='services__card__container'>
        {
          data.map(item=>
            <div className='services__card' >
              <img src={item.image} alt="##" loading='lazy' height='60px' />
              <div>
                <h3>{item.text}</h3>
                <p>{item.subtext}</p>
              </div>
            </div>
          )
        }
    </div>
    </div>
  )
}

export default Courses
